import React, { useEffect, useState } from 'react';
import { ITabProps } from '../types/types';

const Tabs = (props: ITabProps) => {

    const { activeTab, label, onClick } = props

    const doClick = () => {
        onClick(label);
    }

  
      let className = 'tab-list-item';
  
      if (activeTab === label) {
        className += ' tab-list-active';
      }

    return (
        <>
            <li
                className={className}
                onClick={doClick}
            >
                {label}
            </li>
        </>
    )
}

export default Tabs;
